# OpenIDについてわかりやすく解説してみる


### 今日のゴール
* OpenID Connectについて理解を深め、知らない人への説明の練習をする


<img id="09">


## はじめに
OpenID Connectという認証の標準とかいう奴。  
http://openid-foundation-japan.github.io/openid-connect-core-1_0.ja.html  
このような、ながーーーい説明が公式サイトにあります。  
が、OpenID Connect初心者(＝私)は、こんなの読んでもさっぱり意味がわかりません。  
そんな訳で、公式サイトのながーーーい説明を20回ぐらい読んで5割ぐらいは理解したであろう私が  
多少かみ砕いて説明できればとおもいます。



## OpenID Connect概要

### どこで見かける？
* エンジニアの困りごと解決といえばStackOverflowやQiita。
* 登録しようとしたとき、このような画面を見たことありませんか？
 - Twitterでログイン。
 - GitHubでログイン。
<img id="01">
* **TwitterのID/パスワードを入れるだけでログイン**できてしまいます。
 - 面倒な登録は不要。開発者にとってもユーザにとっても楽ちん。
 - ログイン後はTwitterの名前が表示されていたり。
<img id="04">
* この仕組みを実現しているのが**OpenID Connect**です。

### wikiさんはなんていってる？
> 2009年にOAuth 2.0の標準化がIETFで始まったことを受けて策定が始まった、次世代の認証・連合アイデンティティシステムの標準。
> HTTP上で使う場合にはOAuth 2.0をベースにしながら、HTTP以外のプロトコル（XMPP他）にも拡張可能になっており、スマートフォン上でのアプリの台頭を意識した作りになっている。
> セキュリティ的にも、OpenID Authentication 2.0がNIST SP800-63ベースでレベル2程度までしかサポートできないのに対して、最高レベルであるレベル4まで対応できるように設計されている。
> これに当たって、別規格としてJSON Web Token（JWT）、JSON Web Signature（JWS）、JSON Web Encryption（JWE）、JSON Web Key（JWK）が、IETFに於いて、同じ著者達によって標準化されている。

* とても、むずかしい・・・・


### ざっくりいうと？
* 認証と認可。
* 本人確認を行い、確認の結果誰だったかってのを連携する仕組み。
* の、セキュリティ強化版。

<img id="06">



## OpenID Connectの歴史
### OAuth認証
* OAuthという認可の仕組みがありました。
* 上で書いたような、OpenID Connectと同様のID連携の仕組みです。
* (認可はあとで詳しくでてきます)
* OAuthは認可処理だけど、認可には認証が含まれます。
* 「認可されたってことは認証ももちろんされているよね！＾＾」 
* ってことでOAuthが認証に流用されるようになりました。
* これが**OAuth認証**です。  

### OAuth認証セキュリティザル問題
* が、OAuthはあくまで認可であって認証のための仕組みじゃないので、
* 認証そのもののレベルは高くありませんでした。
* でも、  
* 「認証部分を作りこまなくてよくなればかなりお手軽にアプリが作れてしまう＾＾」  
* ということで、人々は悪魔の囁きに負けてOAuth認証を使い続けました。  

### そして現れる新しい仕組み
* そんな悪人どもを更生させるべく立ち上がったのがOpenID界隈の人。  
* 「そんなにOAuthが好きなら、OAuthにセキュアな認証をぶっこんでやろうか！」  
* そうして出来上がったのがOpenID Connectでした。





## OpenID Connect詳細

### OpenID Connect＝アイデンティティ層
* OpenID Connect は、インターネット上の「アイデンティティ層」をなすものです。  
<img id="05">
* OAuth2.0をベースに、アイデンティティ層を拡張した仕様
 - 認証結果の受け渡し + APIアクセス許可を同時に行う

> OAuth 2.0 とは、サービスのユーザーが、サービス上にある自分のデータへのアクセスを、自分のID & パスワードを渡すことなく、第三者のアプリケーションに許可するためのフレームワークである。

* Qiitaの例でいうと？
 - Twitterのユーザーが、
 - Twitter上にある自分のデータへのアクセスを、自分のID & パスワードを渡すことなく、
 - Qiitaに許可する




### 認可と認証

<img id="06">

##### OpenID：認証
* 異なるサービス間でユーザーの認証情報をやりとりする仕様  
* 認証情報
 - 認証時刻
 - 認証方式

##### OAuth：認可
> OAuth 2.0 とは、サービスのユーザーが、サービス上にある自分のデータへのアクセスを、自分のID & パスワードを渡すことなく、第三者のアプリケーションに許可するためのフレームワークである。

* 異なるサービス間でAPIアクセスを実現する仕組み。  
* プロフィールAPIでユーザ識別子を取得してSSOに使っちゃおう！的な発想
* 認可情報
 - どこの：OP識別子
 - だれが：ユーザ識別子
 - いつ：タイムスタンプ
 - どこに：RP識別子



<img id="08">




## OpenID Connect認証フロー
OpenID Connectの認証には大きく分けて3つのフローがあります。

* Authorization Code Flow
 - サーバサイドで認証
* Implicit Flow
 - クライアントサイドで認証
* Hybrid Flow
 - サーバサイド・クライアントサイド両方で認証


 
### Authorization Code Flow
一番基本的でセキュリティの担保された**Authorization Code Flow**を例に、流れを追ってみます

よく見かけるのがこんな感じのフロー図。

<img id="10">

なんか、むずかしい・・・(2回目)

先程のQiitaを例にとって、かみ砕いてみます。

<img id="12">

#### Point
* Authorization Code FlowはリダイレクトURLを指定できるのがミソ。
* リダイレクトは認められた人にしかしない。(そこでセキュリティ強化)



で、上のフロー図に登場人物を当てはめると、こう。

<img id="11">



## まとめ
* OpenID Connectとは、本人確認を行い、確認の結果誰だったかってのを連携する仕組み。
 - の、セキュリティ強化版。
* OAuth認証はセキュリティザルなのでOpenID Connectを使え。
